class Solution {
    func numberOfPowerfulInt(_ start: Int, _ finish: Int, _ limit: Int, _ s: String) -> Int {
        var count = 0
        let length = s.count
        let sValue = Int(s)!

        // Generate all possible prefixes including empty prefix (to cover the case where no prefix is needed)
        var prefixes = [""]
        for _ in 1...length {
            var newPrefixes = [String]()
            for prefix in prefixes {
                for digit in 0...limit {
                    newPrefixes.append("\(prefix)\(digit)")
                }
            }
            prefixes = newPrefixes
        }

        // Check each generated number
        for prefix in prefixes {
            let candidateStr = "\(prefix)\(s)"
            if let candidate = Int(candidateStr), candidate >= start, candidate <= finish {
                // Increment count if candidate is within the range
                count += 1
            }
        }

        // Deduct the count by 1 if s as standalone is counted twice (once as part of prefixes and once alone)
        if Int(s)! >= start && Int(s)! <= finish && prefixes.contains(s) {
            count -= 1
        }

        return count
    }
}
